// 1. Updated App.js - Fix React 18 and session management
import React, { useState, useEffect, createContext, useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import HomePage from './components/HomePage';
import Login from './components/Login';
import Signup from './components/Signup';
import HealthAssessment from './components/HealthAssessment';
import Dashboard from './components/Dashboard';

// Fast Session Manager - Optimized for speed
const SessionManager = {
  SESSION_DURATION: 60 * 60 * 1000, // 1 hour

  isLoggedIn: () => {
    try {
      const user = localStorage.getItem('user');
      const loginTime = localStorage.getItem('loginTime');

      if (!user || !loginTime) return false;

      const sessionAge = Date.now() - parseInt(loginTime);
      if (sessionAge > SessionManager.SESSION_DURATION) {
        SessionManager.logout();
        return false;
      }

      return true;
    } catch {
      return false;
    }
  },

  getCurrentUser: () => {
    if (!SessionManager.isLoggedIn()) return null;

    try {
      return JSON.parse(localStorage.getItem('user'));
    } catch {
      SessionManager.logout();
      return null;
    }
  },

  login: (userData) => {
    try {
      localStorage.setItem('user', JSON.stringify(userData));
      localStorage.setItem('loginTime', Date.now().toString());
      SessionManager.setAutoLogout();
    } catch (error) {
      console.error('Login failed:', error);
    }
  },

  logout: () => {
    localStorage.removeItem('user');
    localStorage.removeItem('loginTime');
    localStorage.removeItem('userLocation');

    if (window.sessionTimeout) {
      clearTimeout(window.sessionTimeout);
    }

    // Only redirect if not already on home page
    if (window.location.pathname !== '/') {
      window.location.href = '/';
    }
  },

  setAutoLogout: () => {
    if (window.sessionTimeout) {
      clearTimeout(window.sessionTimeout);
    }

    window.sessionTimeout = setTimeout(() => {
      alert('Session expired. Please login again.');
      SessionManager.logout();
    }, SessionManager.SESSION_DURATION);
  }
};

// Auth Context
const AuthContext = createContext();

export const useAuth = () => {
  const context = useContext(AuthContext);
  if (!context) {
    throw new Error('useAuth must be used within an AuthProvider');
  }
  return context;
};

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  if (!SessionManager.isLoggedIn()) {
    return <Navigate to="/login" replace />;
  }
  return children;
};

function App() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fast initialization
    const initializeAuth = () => {
      const currentUser = SessionManager.getCurrentUser();
      setUser(currentUser);
      setLoading(false);

      if (currentUser) {
        SessionManager.setAutoLogout();
      }
    };

    initializeAuth();

    // Lightweight activity listener
    const handleActivity = () => {
      if (SessionManager.isLoggedIn()) {
        SessionManager.setAutoLogout();
      }
    };

    // Throttled activity detection
    let activityTimer;
    const throttledActivity = () => {
      if (activityTimer) return;
      activityTimer = setTimeout(() => {
        handleActivity();
        activityTimer = null;
      }, 30000); // Check every 30 seconds
    };

    document.addEventListener('click', throttledActivity);
    document.addEventListener('keydown', throttledActivity);

    return () => {
      document.removeEventListener('click', throttledActivity);
      document.removeEventListener('keydown', throttledActivity);
      if (activityTimer) clearTimeout(activityTimer);
    };
  }, []);

  const authValue = {
    user,
    login: (userData) => {
      SessionManager.login(userData);
      setUser(userData);
    },
    logout: () => {
      SessionManager.logout();
      setUser(null);
    },
    isLoggedIn: () => SessionManager.isLoggedIn()
  };

  // Fast loading screen
  if (loading) {
    return (
      <div style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
        backgroundColor: '#f8fafc'
      }}>
        <div style={{
          width: '40px',
          height: '40px',
          border: '3px solid #e5e7eb',
          borderTop: '3px solid #3b82f6',
          borderRadius: '50%',
          animation: 'spin 1s linear infinite'
        }}></div>
      </div>
    );
  }

  return (
    <AuthContext.Provider value={authValue}>
      <Router>
        <div className="App">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route 
              path="/login" 
              element={user ? <Navigate to="/dashboard" replace /> : <Login />} 
            />
            <Route 
              path="/signup" 
              element={user ? <Navigate to="/dashboard" replace /> : <Signup />} 
            />
            <Route 
              path="/health-assessment" 
              element={
                <ProtectedRoute>
                  <HealthAssessment />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/dashboard" 
              element={
                <ProtectedRoute>
                  <Dashboard />
                </ProtectedRoute>
              } 
            />
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </div>
      </Router>
    </AuthContext.Provider>
  );
}

export default App;
